import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./index.css";

import Signup from "./landing_page/signup/Signup"; // Your login/signup component
import Home from "./components/Home";     // Dashboard/Home page after login

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        {/* Default route shows signup/login */}
        <Route path="/" element={<Signup />} />
        {/* Dashboard route (can be triggered via redirect after login) */}
        <Route path="/dashboard" element={<Home />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);
